package week1.day1;

public class HelloSelenium {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Hello Selenium");
		
		int aInt = 10;
		byte bByte = 5;
		short sShort = 2000;
		long lLong = 999999999L;
		float fFloat = 999999.9f;
		double dDouble = 9999999999.99D;
		char cChar = 'c';
		boolean bBoolean = true;
		String sString = "String World";
		
		System.out.println("Integer - "+aInt);
		System.out.println("Byte - "+bByte);
		System.out.println("Short - "+sShort);
		System.out.println("Long - "+lLong);
		System.out.println("Float - "+fFloat);
		System.out.println("Double - "+dDouble);
		System.out.println("Char - "+cChar);
		System.out.println("Boolean - "+bBoolean);
		System.out.println("String - "+sString);
		
	}

}
